// frontend/src/components/SentimentTable.jsx
import React from "react";

const SentimentTable = ({ data }) => {
  return (
    <div>
      <h3>All Headlines with Sentiment</h3>
      <table border="1" cellPadding="10">
        <thead>
          <tr>
            <th>Headline</th>
            <th>Sentiment</th>
            <th>Date</th>
            <th>Link</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row, index) => (
            <tr key={index}>
              <td>{row.headline}</td>
              <td>{row.sentiment}</td>
              <td>{row.scraped_at}</td>
              <td><a href={row.url} target="_blank" rel="noreferrer">Read</a></td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default SentimentTable;
